import React, { Component } from "react";

class Legende extends Component {
  state = {
    visible: true
  };

  hideLegende() {
    this.setState({
      visible: false
    });
  }

  render() {
    return (
      <div id='legende'>
        <button onClick={this.hideLegende}>Click</button>
      </div>
    );
  }
}

export default Legende;
